import React, { useState, useEffect } from "react";
import axios from "axios";
import './App.css';

const App = () => {
  const [data, setData] = useState([]);


  const fetchData = async () => {
    try{
    const res = await axios.get(
      "https://api.nasa.gov/planetary/apod?api_key=t6p3bUynsAH2pO5wHnA9hbeZmuT6FUbby03zEzJw"
    );
    const response = res.data;
    setData(response);
    }
    catch(error){
      console.log(error);
    }


  };




  console.log(data);





  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div>

        {Object.keys(data).map((item) => {
          return (
            <ul>
<li>Name: {item.date}</li>
              <li>Email: {item.title}</li>
              <li>Email: {item.explanation}</li>
              <li>Email: {item.url}</li>



              <hr />
            </ul>
          );
        })}

    </div>
  );
};

export default App;
